/*Table structure for table `malicious_afected` */

DROP TABLE IF EXISTS `malicious_afected`;

CREATE TABLE `malicious_afected` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `to_userid` int(11) NOT NULL,
  `afected_count` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

